import { Inject, Injectable } from '@angular/core';
import { Observable } from 'rxjs';

import { LeafAuthHttpClient } from '../auth-http-client/leaf-auth-http-client.service';
import { JWTModel, LeafAccountModel, LoginModel, PasswordChangingModel, PasswordResettingModel, RegistrationModel } from '../../models/index';

import { LeafApiClientConfig, LeafApiClientConfigServiceToken } from '../api-client-config.module';

@Injectable()
export class AccountApiClient {
  public constructor(
    @Inject(LeafApiClientConfigServiceToken) public config: LeafApiClientConfig,
    public authHttp: LeafAuthHttpClient
    ) {}

  public me(): Observable<LeafAccountModel> {
    return this.authHttp.get<LeafAccountModel>(this.config.serverUrl + '/account/me');
  }

  public register(registration: RegistrationModel): Observable<JWTModel> {
    return this.authHttp.post<JWTModel>(this.config.serverUrl + '/account', registration);
  }

  public login(login: LoginModel): Observable<JWTModel> {
    return this.authHttp.post<JWTModel>(this.config.serverUrl + '/account/login', login);
  }

  public changeUsername(newUsername: string): Observable<LeafAccountModel> {
    return this.authHttp.post<LeafAccountModel>(this.config.serverUrl + '/account/me/username', newUsername);
  }

  public changePassword(passwordChange: PasswordChangingModel): Observable<LeafAccountModel> {
    return this.authHttp.post<LeafAccountModel>(this.config.serverUrl + '/account/me/password', passwordChange);
  }

  public sendPasswordKey(emailOfAccountToReset: string): Observable<void> {
    return this.authHttp.post<void>(this.config.serverUrl + '/account/sendresetpasswordkey', emailOfAccountToReset);
  }

  public resetPassword(passwordResetting: PasswordResettingModel): Observable<void> {
    return this.authHttp.post<void>(this.config.serverUrl + '/account/resetPassword', passwordResetting);
  }

  public changeAvatar(newAvatarUrl: string): Observable<LeafAccountModel> {
    return this.authHttp.post<LeafAccountModel>(this.config.serverUrl + '/account/me/avatar', newAvatarUrl);
  }
}

import { Injectable, Inject } from '@angular/core';
import { Store } from '@ngrx/store';

// import { LeafAccountModel, LeafAuthorizedEmailModel } from '../../../models/index';
import { LeafAccountModel, LeafAuthorizedEmailModel } from '../../../api/models/index';
import { LeafAuthHttpClient } from '../../../api/clients/index';
import { LeafConfigServiceToken } from '../../leaf-config.module';
import { setAdministrators, setAuthorizedEmails, setUsers } from '../../../store/core/administration/administration.actions';

@Injectable()
export class LeafAdminService {

  constructor(
    private store: Store,
    @Inject(LeafConfigServiceToken) private config,
    public authHttp: LeafAuthHttpClient
  ) {}

  public fetchAuthorizedEmail() {
    this.authHttp
      .get<LeafAuthorizedEmailModel[]>(this.config.serverUrl + '/admin/authorizedemails')
      .subscribe((emails: LeafAuthorizedEmailModel[]) => {
        this.store.dispatch(setAuthorizedEmails({authorizedEmails: emails}));
      });
  }

  public addAuthorizedEmail(emails: string[]) {
    this.authHttp
      .post<LeafAuthorizedEmailModel>(this.config.serverUrl + '/admin/authorizedemails', emails)
      .subscribe(() => this.fetchAuthorizedEmail());
  }

  public removeAuthorizedEmail(emails: string[]) {
    this.authHttp
      .post<LeafAccountModel>(this.config.serverUrl + '/admin/authorizedemails/remove', emails)
      .subscribe(() => this.fetchAuthorizedEmail());
  }

  public fetchAdmins() {
    this.authHttp
      .get<string[]>(this.config.serverUrl + '/admin/admins')
      .subscribe((administrators: string[]) => {
        this.store.dispatch(setAdministrators({administrators}));
      });
  }

  public fetchUsers() {
    this.authHttp
      .get<LeafAccountModel[]>(this.config.serverUrl + '/account/all')
      .subscribe((users: LeafAccountModel[]) => {
        this.store.dispatch(setUsers({users}));
      });
  }

  public deleteAccount(id: any) {
    this.authHttp
      .delete<void>(this.config.serverUrl + '/account/' + id)
      .subscribe(() => {
        this.fetchUsers();
      });
  }

  public addAdmin(newAdminId: string) {
    this.authHttp
      .post<LeafAccountModel>(this.config.serverUrl + '/admin/admins', newAdminId)
      .subscribe(() => this.fetchAdmins());
  }

  public removeAdmin(email: string) {
    this.authHttp
      .delete<LeafAccountModel>(this.config.serverUrl + '/admin/admins/' + email)
      .subscribe(() => this.fetchAdmins());
  }
}

import { HttpClient, HttpHeaders, HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

export interface IRequestOptions {
  headers?: HttpHeaders;
  observe?: 'body';
  params?: HttpParams;
  reportProgress?: boolean;
  responseType?: 'json';
  withCredentials?: boolean;
  body?: any;
}

@Injectable({
  providedIn: 'root',
  useFactory: applicationHttpClientCreator,
  deps: [HttpClient],
})
export class LeafAuthHttpClient {
  public jwtoken: string;

  public constructor(public http: HttpClient) {}

  public setJwtoken(jwtoken: string): void {
    this.jwtoken = jwtoken;
  }

  public addHeaders(options?: IRequestOptions): IRequestOptions {
    const authenticatedOptions = options || { headers: new HttpHeaders() };
    authenticatedOptions.headers =
      authenticatedOptions.headers || new HttpHeaders();
    authenticatedOptions.headers = authenticatedOptions.headers.set(
      'Cache-Control',
      'no-cache'
    );
    authenticatedOptions.headers = authenticatedOptions.headers.set(
      'Pragma',
      'no-cache'
    );
    authenticatedOptions.headers = authenticatedOptions.headers.set(
      'Expires',
      'Sat, 01 Jan 2000 00:00:00 GMT'
    );
    if (this.jwtoken) {
      authenticatedOptions.headers = authenticatedOptions.headers.set(
        'Authorization',
        this.jwtoken
      );
      return authenticatedOptions;
    }
    return options;
  }

  public get<T>(endPoint: string, options?: IRequestOptions): Observable<T> {
    return this.http.get<T>(endPoint, this.addHeaders(options));
  }

  public post<T>(
    endPoint: string,
    params: any,
    options?: IRequestOptions
  ): Observable<T> {
    return this.http.post<T>(endPoint, params, this.addHeaders(options));
  }

  public patch<T>(
    endPoint: string,
    params: any,
    options?: IRequestOptions
  ): Observable<T> {
    return this.http.patch<T>(endPoint, params, this.addHeaders(options));
  }

  public put<T>(
    endPoint: string,
    params: any,
    options?: IRequestOptions
  ): Observable<T> {
    return this.http.put<T>(endPoint, params, this.addHeaders(options));
  }

  public delete<T>(endPoint: string, options?: IRequestOptions): Observable<T> {
    return this.http.delete<T>(endPoint, this.addHeaders(options));
  }
}

export function applicationHttpClientCreator(http: HttpClient) {
  return new LeafAuthHttpClient(http);
}

